import React from "react";
import {Component} from "react";
import {top50} from "../images/top50 global.jpg"


class Homepage extends React.Component {
    constructor(){
        super()
    }
      render(){
          return (
            <div>
            <h1>Homepage</h1>
            <img src={top50} style={height="100",width="100"}/>
            </div>
        )
      }
}

export default Homepage
